import React from 'react';
import { Line } from 'react-chartjs-2';

const CandlestickChart = () => {
  // Sample candlestick data
  const data = {
    labels: ['Jan', 'Feb', 'Mar', 'Apr', 'May', 'Jun'],
    datasets: [
      {
        label: 'Candlestick Chart',
        data: [
          { t: 'Jan', o: 100, h: 150, l: 80, c: 120 },
          { t: 'Feb', o: 120, h: 160, l: 90, c: 140 },
          { t: 'Mar', o: 140, h: 170, l: 110, c: 160 },
          { t: 'Apr', o: 160, h: 180, l: 120, c: 180 },
          { t: 'May', o: 180, h: 190, l: 140, c: 170 },
          { t: 'Jun', o: 170, h: 200, l: 160, c: 190 },
        ],
      },
    ],
  };

  const options = {
    scales: {
      x: {
        title: {
          display: true,
          text: 'Month',
        },
      },
      y: {
        title: {
          display: true,
          text: 'Price',
        },
      },
    },
    plugins: {
      legend: {
        display: true,
        position: 'top',
      },
    },
  };

  return (
    <div>
      <Line data={data} options={options} />
    </div>
  );
};

export default CandlestickChart;
